import axios from "axios";

export const ROUTES = {
  LOGIN_USER: {
    url: "/login",
    method: "post",
  },
};

export const apiCall = ({ method, url, data = {} }) => {
  try {
    const res = axios({
      method,
      url,
      data,
    });
  } catch (err) {}
};
